package leetcode

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestLongestDupSubstring(t *testing.T) {
	a := assert.New(t)
	a.Equal("ana", longestDupSubstring("banana"))
	a.Equal("", longestDupSubstring("abcd"))
	a.Equal("a", longestDupSubstring("aa"))
	a.Equal("", longestDupSubstring(""))
}
